import React from "react";

function GroceryItem({ item, dispatchRemoveGrocery, dispatchEdiGrocery }) {
  return (
    <div>
      <span>{item.value}</span>&nbsp;<span>{item.qty}</span>
      <button onClick={() => dispatchRemoveGrocery(item.id)}>Remove</button>
      <button onClick={() => dispatchEdiGrocery(item.id, item.value)}>
        Edit
      </button>
    </div>
  );
}

export default GroceryItem;
